import React from 'react';
import '../css/FontAwesome.css';

function Skills() {
  return(
    <div className="skills-icons">
      <a href="#" className="outer-shadow"><i className="fab fa-git-alt"></i></a>
      <a href="#" className="outer-shadow"><i className="fab fa-linux"></i></a>
      <a href="#" className="outer-shadow" ><i className="fab fa-github"></i></a>
    </div>
  );
}

export default Skills;
